                } else if (event.key.keysym.sym == SDLK_DOWN && direction!= 0) {
                    direction = 1;
                } else if (event.key.keysym.sym == SDLK_LEFT && direction!= 3) {
                    direction = 2;
                } else if (event.key.keysym.sym == SDLK_RIGHT && direction!= 2) {
                    direction = 3;
                }
            }
        }
    }
    return 0;
}
